★アディダスのジャージセットアップ！<br>
<br>
●スポーツシーンでもオフシーンでも幅広く着こなすことができる「ADIDAS24/7(アディダス トゥエンティフォーセブン)」シリーズが登場！<br>
●デザインにピンストライプを採用し、ジャージに「シンプルかつ洗練」されたスタイルを追求。さらに、動きやすさを高めるストレッチ杢調素材を採用することで、幅広い着こなしと快適な着用感を実現。<br>
●さらさらして気持ちの良い肌触り、吸汗速乾性、ストレッチ性、軽量性を兼ね備えた最先端のジャージ素材を採用しています。<br>
●ポケット口はジッパー仕様となっており、キーや携帯電話など物を入れても落ちる心配がありません。<br>
●上下共に生地はUVカット加工済み紫外線対策も万全のUPF50+！<br>
<br>
■素材 ポリエステル100％<br>
■企画製造販売元 アディダスジャパン株式会社<br>
<br>
